function(x :: Real * x0 :: Real * sy :: Real * sx :: Real) => Real.InaMo.Functions.Fitting.pseudoABTau.falpha.fafunction InaMo.Functions.Fitting.pseudoABTau.falpha.fa"Inline if necessary" "fitting function related to Goldmans formula for the movement of a charged particle in a constant electrical field"
  input Real x "input value";
  input Real x0 = -0.035 "offset for x (fitting parameter)";
  input Real sy = 65.3 "scaling factor for y (fitting parameter)";
  input Real sx = -400.0 "scaling factor for x (fitting parameter)";
  output Real y "result";
  protected Real x_adj "adjusted x with offset and scaling factor";
algorithm
  x_adj := sx * (x - x0);
  if abs(x - x0) < 1e-06 then
    y := sy;
  else
    y := sy * x_adj / (-1.0 + exp(x_adj));
  end if;
end InaMo.Functions.Fitting.pseudoABTau.falpha.fa;

